import React from 'react'

export default function Productcard({ img, title, text, price }) {
    return (
        <div className="product-card col-lg-4 col-md-6 col-sm-12">
            <img src={img} alt={title} />
            <h3>{title}</h3>
            <p>{text}</p>
            <p className="price">${price}</p>
        </div>
    )
}
